const EquipmentListReducer = (state = [], action) => {
  const equipmentList = action.payload;
  console.log(
    "%c [ equipmentList ]",
    "font-size:13px; background:pink; color:#bf2c9f;",
    equipmentList
  );
  switch (action.type) {
    case "SET_EQUIPMENT_LIST":
      state = [...equipmentList];
      return state;
    default:
      return state;
  }
};

export default EquipmentListReducer;
